import React from "react";
import { Link, BrowserRouter as Router } from "react-router-dom";


const Nav = () => {
  return (
    <>
      <Router>
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/student">Students</Link>
            </li>
            <li>
              <Link to="/user">User</Link>
            </li>
          </ul>
        </div>

      </Router>
    </>
  );
};

export default Nav;
